INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('5', '73', 'd606d840-b126-4ef4-8f10-b11d14c4244d', 'LOGIN', 'Hanc omnem quaestionem de finibus bonorum et malorum, id est voluptatem et dolorem? Sunt autem quidam e nostris, et scribentur fortasse plura, si vita suppetet; et tamen, qui diligenter haec, quae vitam omnem continent, neglegentur? Nam, ut sint opera, studio, labore meo.', '2024-01-27 10:10:58');
