INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('11', '23', '8c3a8854-8e87-4df4-babf-2eaa1ee76d25', 'LOGIN', 'Sapienti maximasque ab eo dissentiunt, sed certe non probes, eum quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse, quae pertinerent ad bene vivendum aptior partitio quam illa, qua est usus Epicurus? Qui unum genus.', '2024-01-27 10:41:12');
