INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('29', '78', '7365b2b4-7aa6-445d-85bf-f09253c73977', 'UPDATE_TRANSACTION', 'Et voluptatem pleniorem efficit. Itaque non ob ea solum incommoda, quae eveniunt inprobis, fugiendam inprobitatem putamus, sed multo magis vita et factis et moribus.', '2024-01-27 12:16:10');
INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('30', '42', 'e3b37296-b992-47dc-bf5e-2e6838e6c3fa', 'LOGOUT', 'Haec efficiantur ignorant. Animi autem voluptates et dolores nasci fatemur e corporis.', '2024-01-27 12:20:59');
INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('31', '3', 'e3b37296-b992-47dc-bf5e-2e6838e6c3fa', 'CREATE_REFUND', 'Deinde hoc quoque alienum; nam ante Aristippus, et ille melius. Addidisti ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, mediocritatem desiderent.', '2024-01-27 12:22:23');
INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('32', '63', 'fc53f620-9a91-40dc-a01c-aed6cfca85cf', 'CREATE_TRANSACTION', 'Alia malunt scribi a nobis, aequi esse debent, quod et acutum genus est et ab Epicuro reprehensa et correcta permulta. Nunc dicam de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe, inquam, pertinax non ero tibique, si mihi probabis ea, quae dixi, sole.', '2024-01-27 12:27:36');
