INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('36', '23', 'd75b4440-a4fd-45e3-9a92-204f7c697247', 'LOGIN', 'Ratio est, ut Epicuro placet, nihil dolere, primum tibi recte, Chrysippe, concessum est nihil ad Epicurum. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est cur tam multos legant, quam legendi sunt. Quid enim me prohiberet Epicureum.', '2024-01-27 12:53:53');
INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('37', '11', '451288c2-561c-436c-8fce-df3f7f5157e0', 'LOGOUT', 'Tibi videtur de voluptatibus suis cogitavisse? Sed ut omittam pericula, labores, dolorem etiam, quem optimus quisque pro patria et pro suis suscipit, ut non plus voluptatum habeat quam dolorum. Nam et complectitur verbis.', '2024-01-27 12:55:55');
