INSERT INTO "audit_logs" ("log_id", "user_id", "transaction_id", "action", "description", "created_at") VALUES ('39', '91', '737baa93-e3a2-44b2-8f02-248215163a78', 'LOGOUT', 'Quos quidem video minime esse deterritum. Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Quid ei.', '2024-01-27 13:07:45');
