INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('fd464ee4-eace-44ab-9447-5bf5796624e3', '37', '400.99', 'USD', 'REFUNDED', '14', 'Id reprehendunt, si remissius agatur, sed tantum studium tamque multam.', '2024-01-27 17:10:26', '2024-02-04 15:15:23');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('737baa93-e3a2-44b2-8f02-248215163a78', '51', '563.65', 'USD', 'SUCCESS', '40', 'Quae maestitiam pellat ex animis, quae nos exhorrescere metu non sinat. Qua praeceptrice in tranquillitate vivi potest omnium cupiditatum ardore restincto. Cupiditates enim sunt insatiabiles, quae non modo numquam nocet cuiquam, sed contra semper afficit cum vi sua atque.', '2024-01-27 17:13:46', '2024-01-30 23:05:13');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('507f2790-afd7-4f04-a7d9-4d1390ab643e', '57', '511.73', 'USD', 'PENDING', '93', 'Esse nec ad commodius disserendum viam. In physicis plurimum posuit. Ea scientia et verborum vis et natura orationis et consequentium repugnantiumve ratio potest perspici. Omnium autem rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res.', '2024-01-27 17:21:46', '2024-01-28 11:22:40');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('2a27cc84-389d-4003-aed6-554c3691a13b', '55', '593.07', 'USD', 'REFUNDED', '41', 'Bonum, affirmatis nullam omnino fore. De qua omne certamen est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque maximam, de physicis alias, et quidem tibi et.', '2024-01-27 17:25:10', '2024-02-02 11:46:41');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('8c3a8854-8e87-4df4-babf-2eaa1ee76d25', '91', '516.22', 'USD', 'SUCCESS', '34', 'Triarius te hortatore facimus, consumeret, in quibus tam multis tamque variis ab ultima antiquitate repetitis tria vix amicorum paria reperiuntur, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem.', '2024-01-27 17:32:40', '2024-01-28 19:02:01');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('80472e93-5ea8-45ad-91b8-d93f6ee22b47', '35', '398.28', 'USD', 'SUCCESS', '26', 'Iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi.', '2024-01-27 17:37:15', '2024-01-31 04:32:01');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('0dfc5bc6-2e15-44d0-8157-7463523ed3aa', '86', '585.25', 'USD', 'SUCCESS', '36', 'Sapientia est; sive hoc difficile est, tamen nec modus est ullus investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et mortem contemnit, qua qui utuntur, benivolentiam sibi conciliant et, quod aptissimum est ad cognitionem omnium, regula, ad quam omnia iudicia rerum.', '2024-01-27 17:40:34', '2024-02-05 13:48:23');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('f62c1e5b-31b1-40b9-9884-7d84cdc75c2c', '39', '522.86', 'USD', 'SUCCESS', '99', 'Et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a dolore. Quod cum ita.', '2024-01-27 17:42:44', '2024-02-04 20:56:07');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('244cfce6-696c-4b96-9cbe-7b69078be4d0', '86', '459.18', 'USD', 'PENDING', '56', 'Aut molestiam plus aut ad beatam aut ad beatam aut ad naturam aut contra sit, a natura ipsa iudicari. Ea quid percipit aut quid iudicat, quo aut petat aut fugiat aliquid, praeter voluptatem et dolorem? Sunt autem quidam Epicurei timidiores paulo contra vestra convicia, sed tamen satis acuti, qui verentur ne, si.', '2024-01-27 17:49:26', '2024-02-02 06:46:10');
INSERT INTO "transactions" ("transaction_id", "user_id", "amount", "currency", "status", "payment_method_id", "remarks", "created_at", "updated_at") VALUES ('8806ad1a-1036-4cbc-bcb7-f7bd5b7698c7', '4', '443.51', 'USD', 'REFUNDED', '15', 'Credo. -- ''Non est igitur voluptas bonum.'' Hoc ne statuam quidem dicturam pater aiebat.', '2024-01-27 17:57:25', '2024-02-05 16:32:36');
