INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('1', '90', 'CREDIT', '552.23', 'ccd381f6-3d51-405f-ad80-6c6419d9c6c6', 'Expedire possunt, quod disserunt. Praeterea sublata cognitione et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum. Sic e physicis et fortitudo sumitur contra mortis timorem et constantia contra metum religionis et sedatio animi omnium rerum occultarum ignoratione sublata et moderatio natura cupiditatum generibusque earum explicatis, et, ut dixi, ad lineam.', '2024-01-27 09:58:57');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('2', '4', 'DEBIT', '621.37', 'fc53f620-9a91-40dc-a01c-aed6cfca85cf', 'Atomum perpaulum, quo nihil turpius physico, quam fieri quicquam sine causa dicere, -- et illum motum naturalem omnium ponderum, ut ipse loquerer, tum Triarius leniter arridens.', '2024-01-27 10:04:36');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('3', '38', 'CREDIT', '481.10', '26c8869d-eaa2-42ca-be20-665ab3932c42', 'Mutans, sed ita, ut ea, quae voluptaria, delicata.', '2024-01-27 10:10:41');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('4', '79', 'CREDIT', '555.91', '376266c6-3ef4-4263-a668-2b22175fb1f6', 'Dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de una voluptate quaeri, de qua Epicurus quidem ita dicit, omnium rerum, quas ad beate vivendum sapientia comparaverit, nihil esse prosperum nisi voluptatem, nihil asperum nisi dolorem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac.', '2024-01-27 10:20:21');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('5', '17', 'CREDIT', '571.42', 'dd7ff58c-73d1-41ea-a0ce-280dfe40d84f', 'Quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae sint quaeque cernantur, omnia, eumque motum atomorum nullo a principio.', '2024-01-27 10:24:06');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('6', '15', 'CREDIT', '446.00', 'e32d9f1a-586d-472a-a7ed-db40fc0a05f0', 'Cruciantur, cum sero sentiunt frustra se aut pecuniae studuisse aut imperiis aut opibus aut gloriae. Nullas enim consequuntur voluptates, quarum.', '2024-01-27 10:26:58');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('7', '72', 'CREDIT', '432.08', '0ef9c692-470c-4724-bd8e-caf064fb66a1', 'Non solum videamus, sed etiam quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est.', '2024-01-27 10:32:47');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('8', '70', 'CREDIT', '512.75', '60a90265-aa41-4674-93f9-c1231122d82d', 'Secumque discordans gustare partem ullam liquidae voluptatis et liberae potest. Atqui pugnantibus.', '2024-01-27 10:40:55');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('9', '5', 'DEBIT', '610.19', 'b92ea567-78e2-4a9b-9eb2-efcf16b1843a', 'Isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit.', '2024-01-27 10:48:53');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('10', '84', 'DEBIT', '428.35', '67097fa9-9632-4144-9959-0e8cff6608ea', 'Principio, sed ex aeterno tempore intellegi convenire. Epicurus autem, in quibus tam multis tamque variis ab ultima antiquitate repetitis tria vix amicorum paria reperiuntur, ut ad Orestem pervenias profectus a.', '2024-01-27 10:55:03');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('11', '48', 'CREDIT', '434.54', '05b9acf5-62a1-4e67-9c79-373bdc6b49e9', 'Me istius philosophi non offendit; nam et complectitur verbis, quod vult, et dicit plane.', '2024-01-27 10:57:46');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('12', '45', 'CREDIT', '557.19', 'd00f113a-d33b-4e51-a318-eb0843838cd1', 'Sed id neque feci adhuc nec mihi tamen, ne faciam, interdictum puto. Locos quidem quosdam.', '2024-01-27 11:01:13');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('13', '8', 'DEBIT', '491.79', 'ee3a6e25-0dfe-40a3-ae52-af0a114ef6d0', 'Tantum in alios caeco impetu incurrunt, sed intus etiam in animis nostris inesse notionem, ut alterum esse appetendum, alterum aspernandum sentiamus. Alii autem, quibus.', '2024-01-27 11:10:22');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('14', '10', 'CREDIT', '595.15', 'e32d9f1a-586d-472a-a7ed-db40fc0a05f0', 'Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria, sed ab inliberali labore deterret --, sic isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est difficilius satis facere, qui se dicant in Graecis legendis operam malle consumere.', '2024-01-27 11:17:50');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('15', '79', 'DEBIT', '622.32', '80472e93-5ea8-45ad-91b8-d93f6ee22b47', 'Et Consentinis et Siculis scribere. Facete is quidem, sicut alia; sed neque tam docti tum erant, ad quorum iudicium elaboraret, et sunt illius scripta.', '2024-01-27 11:21:20');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('16', '8', 'DEBIT', '506.53', '7b004dfe-331c-40f7-9852-3ce1953f8510', 'Humili animo inbecilloque ferre miserum est, ob eamque.', '2024-01-27 11:30:32');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('17', '68', 'DEBIT', '449.54', '1879fd4f-3049-41f5-b6bd-c9547daf2505', 'Ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque parte audita pronuntiaret eum non talem videri fuisse in imperio, quales eius maiores fuissent, et in conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis cogitavisse? Sed ut omittam pericula, labores.', '2024-01-27 11:34:29');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('18', '48', 'DEBIT', '616.47', '7ea4fd3a-1b5c-4f5e-a9b0-779a0a95719e', 'Magnis, multis, perpetuis fruentem et animo et.', '2024-01-27 11:43:44');
INSERT INTO "wallet_transactions" ("wallet_transaction_id", "wallet_id", "transaction_type", "amount", "transaction_id", "remarks", "created_at") VALUES ('19', '31', 'CREDIT', '536.57', '451288c2-561c-436c-8fce-df3f7f5157e0', 'Stabilem scientiam rerum tenebimus, servata illa.', '2024-01-27 11:49:43');
